package org.example.Data.BankAccs;import javax.persistence.*;import java.io.Serializable;@Embeddablepublic class AccountKey implements Serializable {    @Column(name = "acc_id")    private long id;    @Column(name = "bank")    private String bank;    public AccountKey() {};    public AccountKey(String bank, long id) {        this.id = id;        this.bank = bank;    }    public String getBank() {        return bank;    }    public long getId() {        return id;    }}